int parser::do_parse()
{
    std::stack<int> status;
    std::stack<int> products;
    int sym,top;
    status.push(0);//push the start status
    products.push(1);//push the end symbols
    top = status.top();
    sym = getc();
    while(true)
    {
        switch(cctab[top][sym][0])
        {
        case SHIFT:
        {
            products.push(sym);
            status.push(cctab[top][sym][1]);
            sym = getc();
            top = status.top();
            break;
        }
        case REDUCE:
        {
            int l;
            switch(cctab[top][sym][1])
            {
            case 0:
            {//accept
                return 0;
                break;
            }
            case 1:
            {//program=>BASIC id LBT RBT block
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 2 ;
                break;
            }
            case 2:
            {//block=>LB decls stmts RB
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 3 ;
                break;
            }
            case 3:
            {//decls=>decls decl
                products.pop();status.pop();
                products.pop();status.pop();
                l = 4 ;
                break;
            }
            case 4:
            {//decls=>%
                l = 4 ;
                break;
            }
            case 5:
            {//decl=>BASIC id SEM
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 5 ;
                break;
            }
            case 6:
            {//id=>volua COMMA id
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 6 ;
                break;
            }
            case 7:
            {//id=>volua
                products.pop();status.pop();
                l = 6 ;
                break;
            }
            case 8:
            {//volua=>ID
                products.pop();status.pop();
                l = 11 ;
                break;
            }
            case 9:
            {//volua=>ID LSB NUM RSB
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 11 ;
                break;
            }
            case 10:
            {//volua=>ID LSB NUM RSB EQUAL LB expr RB
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 11 ;
                break;
            }
            case 11:
            {//volua=>ID EQUAL NUM
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 11 ;
                break;
            }
            case 12:
            {//stmts=>stmts stmt
                products.pop();status.pop();
                products.pop();status.pop();
                l = 7 ;
                break;
            }
            case 13:
            {//stmts=>%
                l = 7 ;
                break;
            }
            case 14:
            {//stmt=>stmvol SEM
                products.pop();status.pop();
                products.pop();status.pop();
                l = 8 ;
                break;
            }
            case 15:
            {//stmt=>IF LBT equality RBT stmt
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 8 ;
                break;
            }
            case 16:
            {//stmt=>IF LBT equality RBT stmt ELSE stmt
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 8 ;
                break;
            }
            case 17:
            {//stmt=>FOR LBT stmvol SEM expr SEM add RBT stmt
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 8 ;
                break;
            }
            case 18:
            {//stmt=>WHILE LBT equality RBT stmt
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 8 ;
                break;
            }
            case 19:
            {//stmt=>block
                products.pop();status.pop();
                l = 8 ;
                break;
            }
            case 20:
            {//stmvol=>loc EQUAL add
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 12 ;
                break;
            }
            case 21:
            {//stmvol=>postfix
                products.pop();status.pop();
                l = 12 ;
                break;
            }
            case 22:
            {//loc=>ID LSB add RSB
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 9 ;
                break;
            }
            case 23:
            {//loc=>ID
                products.pop();status.pop();
                l = 9 ;
                break;
            }
            case 24:
            {//expr=>expr COMMA equality
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 10 ;
                break;
            }
            case 25:
            {//expr=>equality
                products.pop();status.pop();
                l = 10 ;
                break;
            }
            case 26:
            {//equality=>equality ASS rel
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 13 ;
                break;
            }
            case 27:
            {//equality=>equality UEQUAL rel
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 13 ;
                break;
            }
            case 28:
            {//equality=>rel
                products.pop();status.pop();
                l = 13 ;
                break;
            }
            case 29:
            {//rel=>add LT add
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 14 ;
                break;
            }
            case 30:
            {//rel=>add LE add
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 14 ;
                break;
            }
            case 31:
            {//rel=>add GT add
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 14 ;
                break;
            }
            case 32:
            {//rel=>add GE add
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 14 ;
                break;
            }
            case 33:
            {//rel=>add
                products.pop();status.pop();
                l = 14 ;
                break;
            }
            case 34:
            {//add=>add PLUS mult
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 15 ;
                break;
            }
            case 35:
            {//add=>add MIN mult
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 15 ;
                break;
            }
            case 36:
            {//add=>mult
                products.pop();status.pop();
                l = 15 ;
                break;
            }
            case 37:
            {//mult=>mult MULT unary
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 16 ;
                break;
            }
            case 38:
            {//mult=>mult DEV unary
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 16 ;
                break;
            }
            case 39:
            {//mult=>unary
                products.pop();status.pop();
                l = 16 ;
                break;
            }
            case 40:
            {//unary=>EXCLAMA unary
                products.pop();status.pop();
                products.pop();status.pop();
                l = 17 ;
                break;
            }
            case 41:
            {//unary=>postfix
                products.pop();status.pop();
                l = 17 ;
                break;
            }
            case 42:
            {//postfix=>postfix INC
                products.pop();status.pop();
                products.pop();status.pop();
                l = 18 ;
                break;
            }
            case 43:
            {//postfix=>postfix DEC
                products.pop();status.pop();
                products.pop();status.pop();
                l = 18 ;
                break;
            }
            case 44:
            {//postfix=>factor
                products.pop();status.pop();
                l = 18 ;
                break;
            }
            case 45:
            {//factor=>LBT equality RBT
                products.pop();status.pop();
                products.pop();status.pop();
                products.pop();status.pop();
                l = 19 ;
                break;
            }
            case 46:
            {//factor=>loc
                products.pop();status.pop();
                l = 19 ;
                break;
            }
            case 47:
            {//factor=>NUM
                products.pop();status.pop();
                l = 19 ;
                break;
            }
            }
            top = status.top();
            status.push(cctab[top][l][1]);
            products.push(l);
            top = status.top();
            break;
        }
        default:
        {
            std::cout << "error!" << std::endl;
            return -1;
           // error();
        }
        }
    }
    return 0;
}//do_parse

